import './App.css';
import React from 'react';
import { BrowserRouter as Router } from 'react-router-dom';
import { isMobile } from 'react-device-detect';
import desktopRoutes from './routers/desktop';
import mobileRoutes from './routers/mobile';
import HeaderDesktop from './containers/desktop/Header';
import HeaderMobile from './containers/mobile/Header';

function App() {
  if (isMobile) {
    return (
      <div className="App">
        <HeaderMobile />
        <Router routes={mobileRoutes} />
      </div>
    );
  }
  return (
    <div className="App">
      <HeaderDesktop />
      <Router>{desktopRoutes}</Router>
    </div>
  );
}

export default App;
